import { Injectable } from '@angular/core';

@Injectable({  //permite que se injecte en los componentes.
  providedIn: 'root'
})
export class PorfolioService {

  constructor() { }

  messages: string[] = [];

  add(message: string) {
    this.messages.push(message);
  }

}
